import {Button, theme} from '@q-free/ui'; 


const CcsTester: React.FC = () =>{

    const run = ()=>{
        console.log("For the display"); 
    }
    return(
        <div>
            <h2> hi </h2>
            <Button  styles={{
                ...theme.button?.primary,
                width: '40',
                flex: { justify: 'center' },
                rounded: 'full',
                padding: { y: '3', x: '4' },
              }}onClick={run}> 
                  something</Button>
        </div>
    )
}

export default CcsTester;
